import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  background-color: #2A2634;
  margin-top: 32px;
  height: 112px;
  margin-bottom: 80px;
  border-radius: 8px;
  border: 1px solid;

border-image-source: linear-gradient(90deg, #9572FC 0%, #43E7AD 50.52%, #E2D45C 100%);


`;
